import React, { useState } from 'react'
import { signUpApp } from '../authentication/firebase'

const UnauthenticatedMain = () => {

    const handleSubmitNewUser = (email: string, password: string) => {
        signUpApp(email, password)
    }

    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")

    return (
        <div>
            <input 
                type="text"
                value={email}
                placeholder='email'
                autoCorrect='false'
                onChange={ (e) => setEmail(e.target.value)}
            />
            <input 
                type="text"
                placeholder='password'
                autoCorrect='false'
                onChange={ (e) => setPassword(e.target.value)}
            />

            <button onClick={ () => handleSubmitNewUser()}>click to submit</button>
        </div>
    )
}

export default UnauthenticatedMain
